import { Outlet } from "react-router-dom";

const Login = ()=>{
    return(
       <form className="login" method="POST">
         <input className="user-input" name="username" type="text" >Username</input>
         <input className="user-input" name="password" type="password">Password</input>
       </form>
    )
}

export default Login;
